import React from 'react'
import { Header } from './Header';
import './UICONTROL.css';

function holaMundo(){
    alert("HOLA MUNDO2")
}


function UICONTROL() {

    const text = document.createTextNode("Welcome to My channel");
    const pNode = document.getElementById("p");
    pNode.appendChild(text);
    return (
        <div className='interfaz-control'><Header/>
            <div className='pantalla-control'>
                <a onClick={holaMundo()} className='titulo-control'>INTERFAZ DE CONTROL</a>
                <a id="p"></a>
            </div>
        </div>

    )


}

export default UICONTROL;
